    // 初始化边界控制
    initBoundaryControls() {
        // 绑定边界控制事件
        this.bindBoundaryEvents();
    }

    bindBoundaryEvents() {
        // 边界控制按钮事件
        document.getElementById('boundary-toggle').addEventListener('click', () => {
            const boundaryPanel = document.getElementById('boundary-panel');
            boundaryPanel.style.display = boundaryPanel.style.display === 'block' ? 'none' : 'block';
        });

        // 关闭边界面板事件
        document.getElementById('close-boundary-panel').addEventListener('click', () => {
            document.getElementById('boundary-panel').style.display = 'none';
        });

        // 山东省边界控制
        document.getElementById('shandong-boundary').addEventListener('change', (e) => {
            this.toggleBoundary('shandong', e.target.checked);
        });

        // 济南市边界控制
        document.getElementById('jinan-boundary').addEventListener('change', (e) => {
            this.toggleBoundary('jinan', e.target.checked);
        });
    }

    toggleBoundary(type, visible) {
        this.boundaryVisible[type] = visible;
        
        if (this.boundaryLayers[type]) {
            if (visible) {
                this.map.addLayer(this.boundaryLayers[type]);
            } else {
                this.map.removeLayer(this.boundaryLayers[type]);
            }
        }
        
        console.log(`${type}边界${visible ? '显示' : '隐藏'}`);
    }

